    public struct HoloMITActions
    {
        private @HoloMITCustomControls m_Wrapper;
        public HoloMITActions(@HoloMITCustomControls wrapper) { m_Wrapper = wrapper; }
        public InputAction @Move => m_Wrapper.m_HoloMIT_Move;
        public InputAction @Look => m_Wrapper.m_HoloMIT_Look;
        public InputAction @UpDown => m_Wrapper.m_HoloMIT_UpDown;
        public InputAction @Teleport => m_Wrapper.m_HoloMIT_Teleport;
