        public InputAction @Menu => m_Wrapper.m_HoloMIT_Menu;
        public InputAction @Recording => m_Wrapper.m_HoloMIT_Recording;
        public InputActionMap Get() { return m_Wrapper.m_HoloMIT; }
        public void Enable() { Get().Enable(); }
        public void Disable() { Get().Disable(); }
        public bool enabled => Get().enabled;
        public static implicit operator InputActionMap(HoloMITActions set) { return set.Get(); }
        public void AddCallbacks(IHoloMITActions instance)
        {
            if (instance == null || m_Wrapper.m_HoloMITActionsCallbackInterfaces.Contains(instance)) return;
            m_Wrapper.m_HoloMITActionsCallbackInterfaces.Add(instance);
            @Move.started += instance.OnMove;
            @Move.performed += instance.OnMove;
            @Move.canceled += instance.OnMove;
            @Look.started += instance.OnLook;
            @Look.performed += instance.OnLook;
            @Look.canceled += instance.OnLook;
            @UpDown.started += instance.OnUpDown;
            @UpDown.performed += instance.OnUpDown;
            @UpDown.canceled += instance.OnUpDown;
            @Teleport.started += instance.OnTeleport;
            @Teleport.performed += instance.OnTeleport;
            @Teleport.canceled += instance.OnTeleport;
            @Touch.started += instance.OnTouch;
            @Touch.performed += instance.OnTouch;
            @Touch.canceled += instance.OnTouch;
            @Interact.started += instance.OnInteract;
            @Interact.performed += instance.OnInteract;
            @Interact.canceled += instance.OnInteract;
